PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX res: <http://dbpedia.org/resource/>

SELECT ?timezone WHERE {
    res:Salt_Lake_City dbo:timeZone ?timezone .
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?mountain ?elevation
WHERE {
  ?mountain rdf:type dbo:Mountain;
  dbo:location dbr:Germany;
  dbo:elevation ?elevation.
}
ORDER BY DESC(?elevation)
LIMIT 1

SELECT ?president ?termStart ?termEnd 
WHERE {

  ?president dbo:office dbr:President_of_the_United_States ;
             dbo:termPeriod ?term .
  ?term dbo:activeYearsStartYear ?termStart ;
        dbo:activeYearsEndYear ?termEnd .

  FILTER (?termStart <= "1975"^^xsd:gYear && ?termEnd >= "1955"^^xsd:gYear)
}

