}

SELECT ?type WHERE {
  dbr:Taiko dbo:type ?type . 
  FILTER (STRSTARTS(str(?type), "http://dbpedia.org/resource/Category:Japanese_musical_instruments"))
}

SELECT ?loyalty_program (COUNT(?airline) AS ?count) WHERE {
  ?airline dbp:rewardProgram ?loyalty_program .
} 
GROUP BY ?loyalty_program
ORDER BY DESC(?count)
LIMIT 1

PREFIX dbo: <http://dbpedia.org/ontology/>
