SELECT ?country (COUNT(?cave) AS ?caveCount) WHERE {
  ?cave dbo:type dbr:Cave ;
        dbo:location ?place .
  ?place dbo:country ?country .
} GROUP BY ?country
HAVING (COUNT(?cave) > 2)

